import React from 'react';

let name = 'Josh';
let lName = 'Cutcher';
let age = Math.floor(Math.random() * 100);
let gender = [
    'kid',
    'male',
    'female'
];
let genderGenerator = Math.floor(Math.random() * 3);

if(age < 15){
    genderGenerator = 0;
}


const person = () => {
    return <h1>Hello, I'm {name} {lName} and I'm {age} year-old-{gender[genderGenerator]}.</h1>
}

export default person;
